import { createSlice } from '@reduxjs/toolkit'


const initialStatedata = {
  currentSong: {
    "id": 8022,
    "name": "何曼婷",
    "tns": [],
    "alias": [],
    "alia": [],
    "pop": 100.0,
    "st": 0,
    "rt": "600902000009525588",
    "fee": 1,
    "v": 74,
    "crbt": null,
    "cf": "",
    "al": {
      "id": 16949,
      "name": "素颜",
      "picUrl": "http://p2.music.126.net/LMyITvYRS7NsgA9lYUKpqg==/109951164179134667.jpg",
      "tns": [],
      "pic_str": "109951164179134667",
      "pic": 109951164179134667
    },
    "dt": 238733,
  }
}


const playerSlice = createSlice({
  name: 'player',
  initialState: initialStatedata,
  reducers: {
    addCount: (state, actions) => {
      console.log("count+1:", state);
    },
    subCount: (state) => {
      console.log("count-1:", state);
    },
  }
})

export default playerSlice.reducer
